import React, { Component, lazy } from 'react';

import { Route, Routes } from "react-router-dom";

//Containers
//Ejemplos
const UsuariosEjemplo = lazy(() => import('./Samples/UsuariosEjemplo'))
const DepartamentosEjemplo = lazy(() => import('./Samples/DepartamentosEjemplo'))
const DepartamentoFormEjemplo = lazy(() => import('./Samples/DepartamentoFormEjemplo'))

//Proceso Disciplinario
const ProcesoDisciplinario = lazy(() => import('./SistemasDisciplinarios/ProcesoDisciplinario'))

//Captura y Reparto
const CapturaReparto = lazy(() => import('./CapturaReparto/CapturaReparto'))

//Mis Pendientes
const MisPendientes = lazy(() => import('./MisPendientes/MisPendientes'))


//Ramas del proceso
const RamasProceso = lazy(() => import('./RamasProceso/RamasProceso'))


//--Captura y reparto - Antecendentes
const AntecedentesLista= lazy(() => import('./RamasProceso/Antecedentes/AntecedentesLista'))
const AntecedentesForm= lazy(() => import('./RamasProceso/Antecedentes/AntencentesForm'))

//Datos Interesado
const DatosInteresadoForm = lazy(() => import('./RamasProceso/DatosInteresado/DatosInteresadoForm'))

//--Captura y repato - Clasificacion del radicado
const ClasificacionRadicadoForm= lazy(() => import('./RamasProceso/ClasificacionRadicado/ClasificacionRadicadoForm'));
const ClasificacionRadicadoLista= lazy(() => import('./RamasProceso/ClasificacionRadicado/ClasificacionRadicadoLista'));
const ClasificacionRadicadoInfo= lazy(() => import('./RamasProceso/ClasificacionRadicado/ClasificacionRadicadoInfo'));

//--Entidad investigado
const EntidadInvestigadoForm= lazy(() => import('./RamasProceso/EntidadInvestigado/EntidadInvestigadoForm'));
const EntidadInvestigadoLista= lazy(() => import('./RamasProceso/EntidadInvestigado/EntidadInvestigadoLista'));


//function App() {
class RoutesPersoneria extends Component {

  render(){
    return(
      <Routes>
        <Route path="/" element={<UsuariosEjemplo />} />
        <Route path="/Ejemplos" element={<UsuariosEjemplo />} />
        <Route path="/Ejemplos/Departamentos" element={<DepartamentosEjemplo />} />
        <Route path="/Ejemplos/Departamentos/agregar" element={<DepartamentoFormEjemplo />} />
        <Route path="/Ejemplos/Departamentos/:departamentoId" element={<DepartamentoFormEjemplo />} />
        <Route path="/CapturaReparto" element={<CapturaReparto />} />
        <Route path="/ProcesoDisciplinario" element={<ProcesoDisciplinario />} />
        <Route path="/MisPendientes" element={<MisPendientes/>} />
        <Route path="/RamasProceso/:radicado/:procesoDisciplinarioId" element={<RamasProceso/>} />
        <Route path="/AntecedentesLista/:radicado/:procesoDisciplinarioId" element={<AntecedentesLista/>} />
        <Route path="/AntencentesForm/:radicado/:procesoDisciplinarioId" element={<AntecedentesForm/>} />
        <Route path="/ClasificacionRadicadoForm/:radicado/:procesoDisciplinarioId" element={<ClasificacionRadicadoForm/>} />
        <Route path="/ClasificacionRadicadoLista/:radicado/:procesoDisciplinarioId" element={<ClasificacionRadicadoLista/>} />
        <Route path="/ClasificacionRadicadoInfo/:radicado/:clasificacionRadicadoId" element={<ClasificacionRadicadoInfo/>} />
        <Route path="/EntidadInvestigadoForm/:radicado/:procesoDisciplinarioId" element={<EntidadInvestigadoForm/>} />
        <Route path="/EntidadInvestigadoLista/:radicado/:procesoDisciplinarioId" element={<EntidadInvestigadoLista/>} />
        
        <Route path="/DatosInteresadoForm/:procesoDisciplinarioId" element={<DatosInteresadoForm/>} />
      </Routes>
    );
  }

}


export default RoutesPersoneria;
